import { Container, Col } from "react-bootstrap";
import * as React from "react";
import * as ReactDOM from "react-dom";
import { Toolbar, Typography } from "@material-ui/core";
import MenuBookIcon from '@mui/icons-material/MenuBook';
import IconButton from '@mui/material/IconButton';
import FavoriteIcon from '@mui/icons-material/Favorite';

function ToolBarBook() {

    const changePage = (page) => {
        localStorage.setItem('_page', page);
    }


    return (
        <Container style={{ paddingLeft: 15, paddingRight: 15 }}>
            <></><Toolbar>
                <Col align="left" xs={2}>
                    <IconButton onClick={(event) => changePage('1')} >
                        <MenuBookIcon />
                        <Typography valiant="h6">Book Finder</Typography>
                    </IconButton>
                </Col>
                <Col align="left" xs={4}>
                    <IconButton onClick={(event) => changePage('2')} >
                        <FavoriteIcon position="right" />
                        <Typography valiant="h6">Favorite</Typography>
                    </IconButton>
                </Col>
            </Toolbar>
        </Container>
    );
}

export default ToolBarBook;
ReactDOM.render(<ToolBarBook />, document.querySelector("#root"));
